import React from 'react';
import "bootstrap/dist/css/bootstrap.css";
import "./css/search.css"
function Search(){
    return  <div class="search-container input-group rounded">
    <input type="search" class="form-control rounded search-component"  placeholder="Search" aria-label="Search" aria-describedby="search-addon" />
    <span class="input-group-text border-0" id="search-addon">
      <i class="fas fa-search"></i>
    </span>
  </div>
}

export default Search;
